import React from "react";

import {Routes, Route, NavLink, Navigate} from "react-router-dom";
import pages from './components/pages/index';

function App() {

  return (
    <div className="App">
      <Routes>
        <Route path="/" exact component={pages.intro} />
        <Route path="/contact" exact component={pages.contact} />
        <Route path="/financial_info" exact component={pages.financialInfo} />
        <Route path="/financial_info" exact component={pages.businessInfo} />
        <Route path="/financial_info" exact component={pages.policies} />
        <Route path="/financial_info" exact component={pages.industry} />

      </Routes>
    </div>
  );
}

export default App;
